import React, { useEffect, useState } from 'react'
import Container from 'react-bootstrap/Container';
import Typewriter from "typewriter-effect";

const Stream = () => {

  return (
    <Container>
        
        <div className='text'>
          <Typewriter options={{
            autoStart:true,
            loop:true,
            delay:40,
            strings:[
              "I'm a youtube developer",
              "I'm a web developer",
              "I'm a engineer"
            ]
            }}/>
        </div>
    </Container>
  )
}

export default Stream
